import React from 'react';

export default function Dashboard({ feedback }) {
  const total = feedback.length;
  const avg = total === 0 ? 0 : (feedback.reduce((s,f)=>s+Number(f.rating),0)/total).toFixed(2);

  return (
    <div className="card">
      <h2>Dashboard</h2>
      <div>Total feedback: <strong>{total}</strong></div>
      <div>Average rating: <strong>{avg}</strong></div>
    </div>
  );
}
